import React from 'react';
import './QuestionCard.css';

const QuestionCard = ({ question, onClick, onDelete, onLike }) => {
    if (!question || !question.text) {
        return <div>Invalid question data</div>;
    }

    return (
        <div className="question-card" onClick={onClick}>
            <p>{question.text}</p>
            <div className="question-actions">
                <button className="like-btn" onClick={(e) => { e.stopPropagation(); onLike(question.id); }}>
                    ‚ù§
                </button>
                <button className="delete-btn" onClick={(e) => { e.stopPropagation(); onDelete(question.id); }}>
                    üóëÔ∏è
                </button>
            </div>
        </div>
    );
};

export default QuestionCard;
